script: |
  super -f text -I q1285.spq | sort > q1285.out

inputs:
  - name: q1285.spq
    data: |
      SELECT DISTINCT - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT col0 NOT IN ( - tab0.col0 + tab0.col0 + - col0 * - col1 * - tab0.col2 );
  - name: tab0

outputs:
  - name: q1285.out
    data: |
